    vec2 d = texsize.zw*4.0;
    vec3 dx = ( 2.0*((texture(sampler_blur1, _uv+vec2(1.0,0.0)*d).xyz * scale1) + bias1)-2.0*((texture(sampler_blur1, _uv-vec2(1.0,0.0)*d).xyz * scale1) + bias1) );
